<style lang="scss">
    .floorplan-svg {
        height: 100%;
        width: 100%;
        max-height: 100%;
        max-width: 100%;
        object-fit: contain;
    }

    .clock-foreign-object {
        overflow: visible;
        pointer-events: none;
    }

    .clock-container {
        display: flex;
        justify-content: flex-end;
        align-items: flex-start;
        pointer-events: none;
        width: 100%;
        height: 100%;
        box-sizing: border-box;
        padding: 1.25rem 1.5rem 0 0;
        pointer-events: none;
    }

    .clock-stack {
        display: flex;
        flex-direction: column;
        align-items: flex-end;
        gap: 0.75rem;
        pointer-events: auto;
        max-width: max-content;
    }

    .clock-container :global(.clock-date) {
        font-size: 2rem;
    }

    .clock-container :global(.clock-time) {
        font-size: clamp(8rem, 11vw, 12rem);
    }

    .non-interactive {
        pointer-events: none;
    }
    .room {
        &.clickable {
            cursor: pointer;
            outline: none;
            transition:
                fill 0.3s ease,
                filter 0.3s ease;
        }
        &:focus {
            outline: none;
        }
        &.free {
            @apply fill-room-free;
        }
        &.almostfree {
            @apply fill-room-almostfree;
        }
        &.occupied {
            @apply fill-room-occupied;
        }
        &.clicked {
            filter: brightness(0.8);
        }
    }
    .door {
        &.visible {
            display: block;
        }
        &.hidden {
            display: none;
        }
    }
